import React from 'react'
import './fundoPreto.css'
import PinterestLogo from './assets/img/pinterest_PNG45.png'

const Pinterest = () => (
	<div className='pinterest'>
		<img className='pinterestLogo' src={PinterestLogo} alt='logo'></img>
	</div>
)

const Home = props => {
	const { name } = props
	return <button className='fundoPreto fundoPretoMenor'>{name}</button>
}

const Following = props => {
	const { name } = props
	return <button className='fundoPreto'>{name}</button>
}

